import React from 'react'


const lakes = () => {
     fetch('/lakes')
    .then(res => res.json())
    .then(rsp => {
        return <div>{rsp}</div>
    })
}

const Home = () =>{
    
    return <div>
        <h1>THIS IS HOME</h1>
        <div>{lakes()}</div>
        
    </div>
}
export default Home
